pragma solidity >=0.6.8;

import "./BepLib.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

library Utils {
    using SafeMath for uint256;

    function swapTokensForEth(address routerAddress, uint256 tokenAmount)
        public
    {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(routerAddress);

        // generate the pancake pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = pancakeRouter.WETH();

        // make the swap
        pancakeRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of BNB
            path,
            address(this),
            block.timestamp
        );
    }

    function swapBNBForToken(
        address routerAddress,
        address tokenAddress,
        address recipient,
        uint256 bnbAmount
    ) public {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(routerAddress);

        // Generate the pancake pair path of token => WETH
        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        // path[1] = address(0xd66c6B4F0be8CE5b39D52E0Fd1344c389929B378);
        path[1] = tokenAddress;

        // Swap
        pancakeRouter.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: bnbAmount
        }(0, path, address(recipient), block.timestamp + 360);
    }

    function swapETHForTokens(
        address routerAddress,
        address recipient,
        uint256 ethAmount
    ) public {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(routerAddress);

        // generate the pancake pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        path[1] = address(this);

        // make the swap
        pancakeRouter.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: ethAmount
        }(
            0, // accept any amount of BNB
            path,
            address(recipient),
            block.timestamp + 360
        );
    }

    function addLiquidityForTokens(
        address _routerAddress,
        address _tokenAddress,
        address _to,
        uint256 _bnbAmount
    ) public {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(_routerAddress);
        // generate the pancake pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        path[1] = address(_tokenAddress);

        uint256 size1 = pancakeRouter.getAmountsOut(_bnbAmount, path)[1];

        pancakeRouter.addLiquidityETH{value: _bnbAmount}(
            _tokenAddress,
            size1,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            _to,
            block.timestamp + 360
        );
    }

    function addLiquidity(
        address routerAddress,
        address owner,
        uint256 tokenAmount,
        uint256 ethAmount
    ) public {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(routerAddress);

        // add the liquidity
        pancakeRouter.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            owner,
            block.timestamp + 360
        );
    }

    function getReturnAmount(
        address _routerAddress,
        uint256 _amount,
        address _token
    ) public view returns (uint256) {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(_routerAddress);
        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        path[1] = address(_token);

        return pancakeRouter.getAmountsOut(_amount, path)[1];
    }
}
